run_tests() ->

  Ranges = [1, 5, 10, 50, 100, 500, 1000, 5000, 10000],
  Values = [ run_test(X)/1000 || X <- Ranges ],
  Rows = lists:zip(Ranges, Values),
  io:format("~tp~n", [Rows]).


